import React  from "react";

const What=(state)=>{
     const {items} = state;
  
return          
  (
    items.map=(item=>{
        return(
            <div key={item.id}>
{item.id}
{item.name}
{item.age}
            </div>

        )
}
    )
)        
    
}
export default What;
